glsl1.vert:
precision highp float;
uniform highp mat4 cc_matViewProj;
attribute vec3 a_position;
attribute vec2 a_texCoord;
attribute vec4 a_color;
varying vec4 color;
varying vec2 uv0;
vec4 vert () {
  vec4 pos = vec4(a_position, 1);
  pos = cc_matViewProj * pos;
  uv0 = a_texCoord;
  color = a_color;
  return pos;
}
void main() { gl_Position = vert(); }

glsl1.frag:
precision highp float;
vec4 CCFragOutput (vec4 color) {
  return color;
}
uniform sampler2D cc_spriteTexture;
varying vec2 uv0;
   uniform vec4 strokeColor;
   uniform vec4 fillColor;
   uniform vec4 shaowColor;
   uniform float strokeWidth;
   uniform float shadowWidth;
vec4 drawEdgeStroke(){
  vec4 col1 =texture2D(cc_spriteTexture,uv0);
  if(col1.a>0.2) {
    return vec4(fillColor.rgb,texture2D(cc_spriteTexture,uv0).a);
  }
  else {
    #if USE_STROKE
      vec4 col2 = texture2D(cc_spriteTexture, uv0+vec2(strokeWidth,0.));
      vec4 col3 = texture2D(cc_spriteTexture, uv0+vec2(-strokeWidth,0.));
      vec4 col4 = texture2D(cc_spriteTexture, uv0+vec2(0.,strokeWidth));
      vec4 col5 = texture2D(cc_spriteTexture, uv0+vec2(0.,-strokeWidth));
      vec4 col6 = texture2D(cc_spriteTexture, uv0+vec2(strokeWidth,strokeWidth));
      vec4 col7 = texture2D(cc_spriteTexture, uv0+vec2(strokeWidth,-strokeWidth));
      vec4 col8 = texture2D(cc_spriteTexture, uv0+vec2(-strokeWidth,strokeWidth));
      vec4 col9 = texture2D(cc_spriteTexture, uv0+vec2(-strokeWidth,-strokeWidth));
      vec4 col_average = (col1+col2+col3+col4+col5+col6+col7+col8+col9)/9.;
      col_average.a = smoothstep(.01,.05,col_average.a);
      if(col_average.a>.05) return vec4(strokeColor.rgb,col_average.a);
      #if USE_SHAOW
        vec4 col10 = texture2D(cc_spriteTexture,uv0+vec2(-shadowWidth));
        col10.a = smoothstep(0.2,0.25,col10.a);
        if(col10.a>0.2) return vec4(shaowColor.rgb,col10.a);
      #endif
    #endif
    discard;
  }
}
vec4 frag () {
  vec4 col = drawEdgeStroke();
  return CCFragOutput(col);
}
void main() { gl_FragColor = frag(); }

